<p>&nbsp;</p>
<p><b><span style="font-size: 14pt;">Дополнительные элементы:</span></b></p>
<p><span style="text-decoration: underline;"><span style="font-size: 14pt;">Запорный механизм:</span></span></p>
<p><span style="font-size: 14pt;">1) талрепы (включено)</span></p>
<p><span style="font-size: 14pt;">2) замок контейнерного типа = 1500 руб.</span></p>
<p><span style="text-decoration: underline;"><span style="font-size: 14pt;">Покраска, 2.5х2.5:</span></span></p>
<p><span style="font-size: 14pt;">1) Нитроэмаль черная = 2000 руб.</span></p>
<p><span style="font-size: 14pt;">2) Полимерное покрытие (только створки 500р.*м2) </span></p>
<p><b><span style="font-size: 14pt;">Опции:</span></b></p>
<p><span style="font-size: 14pt;">- Демонтаж старых ворот = 800 руб.</span></p>
<p><span style="font-size: 14pt;">- Уплотнительный уголок по периметру (до 2.5х2.5м):</span></p>
<p><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp; Без калитки = 2500 руб.</span></p>
<p><span style="font-size: 14pt;">&nbsp;&nbsp;&nbsp;&nbsp; С калиткой = 3500 руб. </span></p>
<p><span style="font-size: 14pt;">- Козырек над гаражом = 3000-4500 руб. (с установкой)</span></p>
<p><span style="font-size: 14pt;">- Противооткрывающиеся штыри от ветра =500 руб.</span></p>
<p><span style="font-size: 14pt;">- Противосъёмные блокираторы = 500 руб.</span></p>
<p><span style="font-size: 14pt;">- Уголок жесткости на внешнюю створку = 400 руб.</span></p>
<p><span style="font-size: 14pt;">- Объемная коробка вместо односторонней (в процессе строительства гаража) 2.5х2.5х0.3:</span></p>
